	//printEndDate('月薪宝ZT0412252期',monthToDate);
	
	function printEndDate(contactNum,endDateStr){
		var endTimeArr=endDateStr.split(/[ ]+/);
		var msg='';
		
		//取得数字期数
		var num2 = contactNum.replace(/[^0-9]/ig,"");
		num2 = num2.slice(num2.length-3);
		num2 = Number(num2);
		
		for(var i=0;i<endTimeArr.length;i++){
			if((i+2)%2===0){
				var num1 = endTimeArr[i].replace(/[^0-9]/ig,"");
			
				//var num3 = endTimeArr[i+2].replace(/[^0-9]/ig,"");
				//取最后三位数
				num1 = num1.slice(num1.length-3);
				num1 = Number(num1);
			
				
				//如果当前的期数大于等于前面的期数，而小于后面的期数，那么截止日期就是前面期数后面的数组值
				if(num2<num1){
					msg = ' 截止日期为:'+endTimeArr[i-1];
					break;
				}
				if(num2===num1){
					msg = ' 截止日期为:'+endTimeArr[i+1];
					break;
				}
			}
		}
		
		document.write(msg);
		
	}
</script>
